import React from 'react';
import {
  AppBar, Button, IconButton, Toolbar, Typography, STack
} from '@mui/material';

export default function Navbar() {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          Penn Buddy
        </Typography>
        <Stack direction="row" spacing={2}>
          <Button color="inherit">Activity Feed</Button>
        </Stack>
      </Toolbar>
    </AppBar>
  );
}

